def searchInsert(nums, target):    """    :type nums: List[int]    :type target: int    :rtype: int    """    if len(nums) == 0:        return 0    elif target < nums[0]:        return 0    elif target > nums[-1]:        return len(nums)    else:        l = 0        h = len(nums) - 1        while h - l > 1:            if nums[(l + h) // 2] == target:                return (l + h) // 2            elif nums[(l + h) // 2] < target:                l = (l + h) // 2            elif nums[(l + h) // 2] > target:                h = (l + h) // 2        print(l, h)        if nums[l] == target:            return l        else:            return hprint(searchInsert([3, 5, 7, 9, 10], 8))